var ICONS_NOT_SYMBOLS = (
	[...top.document.querySelectorAll("link")].at(-1).href.includes("family=Material+Icons")
);

var sanitized = v => {
	if(ICONS_NOT_SYMBOLS) {

		// fine inside Material+Symbols+Outlined ... but MISSING from Material+Icons
		if(MISSING_FROM_ICONS.includes(v)) {
			return "```";	// future MIGHT see if there are just different short_names maybe?
		};
	};

	return v.toLowerCase().replace(/[ ]/g, "_");
};

var rotation = () => ROTATE_DISABLED ? "" : (
		'class="rotating"' + (
		Math.random() < 0.5
		? ""
		: ' style="--rot-dir: -1"'
	)
);

ICONS = ICONS.split("\n").filter(Boolean);

[document.getElementById("container")].forEach(el => {
	var html = [];

	ICONS.forEach( (icon, i) => html.push(
		i && !( i % 6 ) ? `\n<br />` : ``,
		`<span title="${icon}" ${rotation()}>${sanitized(icon)}</span>`
	) );

	el.innerHTML = html.join("\n");
});

</script>

</body>

</html>
